from hypothesis import given, strategies as st
from pydantic import BaseModel
from pydantic.experimental.pipeline import transform


@given(st.integers(min_value=1, max_value=100))
def test_not_in_constraint_crashes(x):
    class Model(BaseModel):
        value: int = transform(lambda v: v).not_in([5, 10, 15])

    if x not in [5, 10, 15]:
        m = Model(value=x)
        assert m.value == x
    else:
        # These values should be rejected
        try:
            m = Model(value=x)
            # If we get here, the constraint didn't work
            raise AssertionError(f"Value {x} should have been rejected by not_in constraint")
        except ValidationError:
            # This is expected
            pass

# Run the test
test_not_in_constraint_crashes()

